  @ViewChild('readMoreBtn', { static: false }) readMoreBtn!: ElementRef;
  @ViewChild('fullText', { static: false }) fullText!: ElementRef;

  @ViewChildren('skillCard') skillCards!: QueryList<ElementRef>;

  ngAfterViewInit() {
    this.readMoreBtn.nativeElement.addEventListener('click', () => {
      this.fullText.nativeElement.classList.toggle('show');
      const span = this.readMoreBtn.nativeElement.querySelector('span');
      if (span) {
        span.textContent = this.fullText.nativeElement.classList.contains(
          'show'
        )
          ? 'Show Less'
          : 'Read More';
      }
    });

    const text = document.querySelector('.animate-text') as HTMLElement;
    const image = document.querySelector('.animate-image') as HTMLElement;

    setTimeout(() => {
      text.style.opacity = '1';
      text.style.transform = 'translateX(0)';
      image.style.opacity = '1';
      image.style.transform = 'translateX(0)';
    }, 200);

    const observer = new IntersectionObserver(
      (entries) => {
        entries.forEach((entry) => {
          if (entry.isIntersecting) {
            entry.target.classList.add('show');
          }
        });
      },
      { threshold: 0.3 }
    );

    this.skillCards.forEach((card) => observer.observe(card.nativeElement));
  }
